export default function ButtonAppBar() {
  const classes = useStyles();
  const { token, likes } = useSelector((state) => state.viewer);
  const dispatch = useDispatch();
  const history = useHistory();
  useEffect(() => {
    if (likes.length > 0) {
      return;
    }
    const fetchData = async () => {
      const result = await fetch("http://localhost:3001/api/likes", {
        method: "get",
        headers: { "content-type": "application/json" },
      });
      dispatch(setViewerLikes(await result.json()));
    };
    fetchData();
  }, []);
  const handleSignOut = () => {
    localStorage.removeItem("token");
    dispatch(setViewerLikes([]));
    dispatch(setViewerToken(null));
    history.push("/");
  };

  return (
    <div className="ss" expand="lg">

      <div className={classes.root} >

        <Grid container spacing={3} >
          <AppBar position="sticky" className={classes.header} className="head">
            <Toolbar variant="dense">

           <div className="fa">
              <Button to="/" component={Link}>
                <FontAwesomeIcon
                  icon={faHouseUser}
                  style={{ fontSize: "30px" }}
                />
              </Button>
              <Button component={Link} to="/home" color="inherit">
                <FontAwesomeIcon icon={faSearch} style={{ fontSize: "30px" }} />
              </Button>
              <Button to="../Home/saveRecipe" component={Link} color="inherit">
                <FontAwesomeIcon icon={faHeart} style={{ fontSize: "30px" }} />
                {likes.length}
              </Button>
              </div>

              {/* <div className="nav"> */}
              {/* <img alt="Remy Sharp" src="https://listimg.pinclipart.com/picdir/s/52-526222_fork-clipart-spoon-fork-logo-restaurant-business-card.png" /> */}
              {/* </div> */}
              <div className={classes.circ}> 
              <Avatar alt="" src="data:image/png;base64," className={classes.small} />
              <Avatar alt="" src="data:image/png;base64," className={classes.smallw}/>
              <Avatar alt="" src="data:image/png;base64," className={classes.large} />
              <Avatar alt="" src="data:image/png;base64," className={classes.largee} />
              <Avatar alt="" src="data:image/png;base64," className={classes.large} />
              <Avatar alt="" src="data:image/png;base64," className={classes.largee} />
              </div>

              <Grid item xs={12} sm={6}>
                {token ? (
                  <Button color="inherit" onClick={handleSignOut}>
                    Sign Out
                  </Button>
                ) : (
                    <div className="sign">
                      <Button
                      
                        to="/signup"
                        component={Link}
                        color="inherit"
                      >
                        <FontAwesomeIcon
                          icon={faSignOutAlt}
                          style={{ fontSize: "30px" }}
                        />
                      </Button>
                      <Button to="/signin" component={Link} color="inherit">
                        <FontAwesomeIcon
                          icon={faSignInAlt}
                          style={{ fontSize: "30px" }}
                        />
                      </Button>
                    </div>
                  )}
              </Grid>

            </Toolbar>
          </AppBar>

        </Grid>
      </div>
    </div>
  );
}
